import './App.css';
import Navbar from './components/navbar/navbar';
import {KebabHorizontalIcon, XIcon} from '@primer/octicons-react';

function fetchReminders() {

}

function App() {
  return (
    <div className="App">
        <Navbar />
        <ul id="remindersWrapper">
            <div className="reminder">
                <div className={"reminderInfo"}>
                    <h2 className={"reminderTitle"}>Reminder Name</h2>
                    <p className={"reminderDescription"}><span className={"descriptionPrefix"}>Remind me to:</span> Hi</p>
                </div>
                <div className={"reminderActions"}>
                    <button className={"button"}><KebabHorizontalIcon size={16}
                                                                      fill={"#cfcccc"}
                                                                      verticalAlign={"middle"}/></button>
                    <button className={"button"}><XIcon size={16}
                                                                      fill={"#cfcccc"}
                                                                      verticalAlign={"middle"}/></button>
                </div>
            </div>
        </ul>
    </div>
  );
}

export default App;
